import React from "react";
import { Link } from "react-router-dom";
function Home(props) {
  return (
    <div style={{ padding: "20px" }}>
      <div >BNK48 Facial Recognition App</div>
      <div style={{ padding: "20px" }}>
        <Link to='/photo'>Photo Input</Link>
      </div>
      <div>
        <Link to='/video'>Video Camera</Link>
      </div>
    </div>
  );
}

export default Home;
